hun eigen planeet vernietigd hebben om de baby's op te sporen. 
De baby's hebben allemaal een eigen lijfwacht en ze zullen superkrachten 
krijgen wanneer ze ouder worden. Ze hebben allemaal een nummer van ÃƒÆ’Ã‚Â©ÃƒÆ’Ã‚Â©n tot 
