Number Four (Alex Pettyfer), ook John Smith genaamd, verhuist naar Paradise, 
Ohio en wordt vrienden met de vriendelijke fotograaf Sarah. Na zijn hele 
leven op de vlucht te zijn geweest is Number Four verliefd geworden en heeft 
hij iets om voor te vechten.

Storyline:

John is an extraordinary teen, masking his true identity and passing as 
a typical high school student to elude a deadly enemy seeking to destroy him. 
Three like him have already been killed ... he is Number Four. 



